CREATE PROCEDURE public.updatemeta()
    LANGUAGE plpgsql
    AS $$
	begin
			select c.id,1 
			from clear c 
			left join flatsmeta fm on c.id=fm.id
			where fm.id is null;
		select 
			current_timestamp,
			(select count(*) from flatsmeta),
